@Override
public boolean load(InputStream input) throws IOException {
  try {
    this.fst = new FST<Long>(new InputStreamDataInput(input), PositiveIntOutputs.getSingleton(true));
  } finally {
    IOUtils.close(input);
  }
  return true;
}

